import React from 'react';
import QRCodeScanner from '../components/QRCodeScanner';

const QRCodeScannerPage = () => (
  <div>
    <h1>Scan QR Code</h1>
    <QRCodeScanner />
  </div>
);

export default QRCodeScannerPage;
